import React, { useState } from "react";
import SearchIcon from "@mui/icons-material/Search";
import ShoppingCartOutlinedIcon from "@mui/icons-material/ShoppingCartOutlined";
import { Link } from "react-router-dom";
import "./NavigationBar.css";

const NavigationBar = () => {
  const [hoveredItem, setHoveredItem] = useState(null);
  const [isSearchOpen, setIsSearchOpen] = useState(false);
  const [searchQuery, setSearchQuery] = useState("");
  const [products, setProducts] = useState([]);
  const [cartCount, setCartCount] = useState(0);

  const toggleSearch = () => setIsSearchOpen(!isSearchOpen);

  const handleSearch = async (e) => {
    e.preventDefault();
    const response = await fetch(`/api/products?search=${searchQuery}`);
    const data = await response.json();
    setProducts(data);
  };

  const handleMouseEnter = (item) => {
    setHoveredItem(item);
  };

  const handleMouseLeave = () => {
    setHoveredItem(null);
  };

  return (
    <div className="navbar-container">
      {/* Black bar */}
      <div className="navbar-black">
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("new")}
          onMouseLeave={handleMouseLeave}
        >
          New <svg xmlns="http://www.w3.org/2000/svg" height="24px" viewBox="0 -960 960 960" width="24px" fill="#5f6368"><path d="M480-344 240-584l56-56 184 184 184-184 56 56-240 240Z"/></svg>
        </div>
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("clothing")}
          onMouseLeave={handleMouseLeave}
        >
          Brands <svg xmlns="http://www.w3.org/2000/svg" height="24px" viewBox="0 -960 960 960" width="24px" fill="#5f6368"><path d="M480-344 240-584l56-56 184 184 184-184 56 56-240 240Z"/></svg>
        </div>
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("shoes")}
          onMouseLeave={handleMouseLeave}
        >
          Bags <svg xmlns="http://www.w3.org/2000/svg" height="24px" viewBox="0 -960 960 960" width="24px" fill="#5f6368"><path d="M480-344 240-584l56-56 184 184 184-184 56 56-240 240Z"/></svg>
        </div>
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("brands")}
          onMouseLeave={handleMouseLeave}
        >
          MARKA <svg xmlns="http://www.w3.org/2000/svg" height="24px" viewBox="0 -960 960 960" width="24px" fill="#5f6368"><path d="M480-344 240-584l56-56 184 184 184-184 56 56-240 240Z"/></svg>
        </div>
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("bags")}
          onMouseLeave={handleMouseLeave}
        >
          ÇANTA <svg xmlns="http://www.w3.org/2000/svg" height="24px" viewBox="0 -960 960 960" width="24px" fill="#5f6368"><path d="M480-344 240-584l56-56 184 184 184-184 56 56-240 240Z"/></svg>
        </div>
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("accessories")}
          onMouseLeave={handleMouseLeave}
        >
          AKSESORË <svg xmlns="http://www.w3.org/2000/svg" height="24px" viewBox="0 -960 960 960" width="24px" fill="#5f6368"><path d="M480-344 240-584l56-56 184 184 184-184 56 56-240 240Z"/></svg>
        </div>
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("sale")}
          onMouseLeave={handleMouseLeave}
        >
          SALE
        </div>
        <div
          className="navbar-item"
          onMouseEnter={() => handleMouseEnter("outlet")}
          onMouseLeave={handleMouseLeave}
        >
          OUTLET
        </div>

        {/* Search and Cart Icons */}
        <div className="icon-container">
          <div className="search-container navbar-item">
            <SearchIcon className="icon" onClick={toggleSearch} />
            {isSearchOpen && (
              <input
                type="text"
                placeholder="Search for products..."
                className="search-input"
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
              />
            )}
          </div>

          <Link to="/cart" className="cart-icon navbar-item">
            <ShoppingCartOutlinedIcon className="icon" />
            <span className="cart-count">{cartCount}</span>
          </Link>
        </div>
      </div>

      {/* White dropdown */}
      <div className={`dropdown-container ${hoveredItem ? "active" : ""}`}>
        {hoveredItem === "accessories" && (
          <div className="dropdown-content">
            <div className="dropdown-column">
              <a href="#">Rripa</a>
              <a href="#">Kapelet</a>
              <a href="#">Çantë Kozmetike</a>
              <a href="#">Çorape</a>
              <a href="#">Të Tjera</a>
            </div>
            <div className="dropdown-column">
              <a href="#">Kapucë Dhe Dorashka</a>
              <a href="#">Syze Dielli</a>
              <a href="#">Portofol</a>
              <a href="#">Shaje</a>
            </div>
            <div className="dropdown-image">
              <img src="path_to_image" alt="Scotch & Soda" />
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default NavigationBar;
